INSERT INTO "SPARTAN_WOD" VALUES(1,'A Work of Art','athleticism','The human foot is a masterpiece of engineering and a work of art.','Leonardo da Vinci','Put those feet to good use in this workout. Celebrate your abilities by maximizing them.',NULL,1,2,3,4,5,6);
INSERT INTO "SPARTAN_WOD" VALUES(2,'Burpee-fest','athleticism','From the little spark may burst a mighty flame.','Dante','From a simple bodyweight exercise you can discover an entire world of fitness. Likewise, one simple workout can lead you to brand new capabilities. Burpees are simple and powerful. When in doubt on how to train, do burpees while you think about it. Master the burpee, and everything else will fall into place. How many burpees can you do in one day? If you dont know, find out by scheduling 15 minutes 2-4 times in the day where you can commit to doing burpees. Or, just set aside an hour and go for it!','',7,8,9,10,11,12);
INSERT INTO "SPARTAN_WOD" VALUES(3,'Cheaper than Healthcare','athleticism','','','','',13,14,15,16,17,18);
INSERT INTO "SPARTAN_WOD" VALUES(4,'Do You Dare?','athleticism','It is not because things are difficult that we do not dare; it is because we do not dare that things are difficult.','Seneca','','',19,21,22,23,24,20);
INSERT INTO "SPARTAN_WOD" VALUES(5,'Fast Intervals','athleticism','To be is to do.','Immanuel Kant','','',25,26,27,28,29,30);
INSERT INTO "SPARTAN_WOD" VALUES(6,'Fathers Day WOD','athleticism','One father is more than a hundred schoolmasters.','George Herbert','Todays Fathers Day workout is meant for you and your kids to do together. Show your children how far you can push yourself by doing as many sets as you can. Repeat up to 10x. If your kid(s) get tired, pick them up and carry them on your back, then finish your sets!  Finish by stretching with your kids.','Fathers Day',31,32,33,34,35,36);
